const Images = {
    pic1: require('./pic1.jpg').default,
    pic2: require('./pic2.jpg').default,
    pic3: require('./pic3.jpg').default,
    pic4: require('./pic4.jpg').default,
    pic5: require('./pic5.jpg').default,
    pic6: require('./pic6.jpg').default,
}

export { Images }
